def main():
    n = int(input())
    words = input().split(' ')
    for i in range(n-1):
        if words[i] == 'mumble':
            continue
        if int(words[i]) != i+1:
            print('something is fishy')
            return
    print('makes sense')

if __name__ == '__main__':
    main()

